import React from "react";

import "../styles/content.css"

type Object = {
    x: number;
    y: number;
    type: "chair" | "table" | "sitting";
};

type Info = {
    time: number
    now?: number
    data: Object[]
}

type Props = {
    objects: Info;
};

const countObjects = (objects: Object[], targetType: Object['type']): number => {
    let count = 0;

    objects.forEach((objects) => {
        if (objects.type === targetType) {
            count++
        }
    })
    return (count)
}

const ShowAvailable = ({ objects }: Props) => {
    return (
        <>
            <div className="trafficLight">
                신호등
            </div>
            <div className="showAvailable">
                <h2>1층 오픈 스튜디오의 사용률:</h2>
                <h2 className="showAvailable_percent">
                {countObjects(objects.data, "sitting") / countObjects(objects.data, "chair")}%
                </h2>
            </div>
            <div className="showChair">
                <h2>1층 오픈 스튜디오에 있는 의자 이용률:</h2>
                <h2 className="showChair_percent">
                {countObjects(objects.data, "sitting")} / {countObjects(objects.data, "chair")}
                </h2>
            </div>
        </>
    )
}

export default ShowAvailable
